import React from 'react';

const Nav = ({}) => (
  <div class="ui secondary vertical pointing menu">
  <a class="active item">
    Home
  </a>
  <a class="item">
    Messages
  </a>
  <a class="item">
    Friends
  </a>
</div>
);

export default Nav;
